import {useNavigate,useParams} from 'react-router-dom'
export default function     (){

    let {params}=useParams();
    navigate=()=>{
        useNavigate("/")
    }
    return <div>
        id:{params}<br/>
        <button className="btn btn-success" onClick={
            this.navigate()
        }>Retour</button>
    </div>
}
